/* Initialize dimensions of the logs */
void initialize_logs(){
  log1.height = 30;
  log2.height = 30;
  log3.height = 30;
  log1.width = 50;
  log2.width = 75;
  log3.width = 100;
}


int within_bounds(int x, int y){
  if (x < 0 || x >= SCREEN_WIDTH || y < 0 || y >= SCREEN_HEIGHT){
   // printf("CAN'T DRAW! Out of Bounds");
    return 0;
  }

  return 1;
}

void initialize_frog(){
    frog.width = 25;
    frog.height = 25;
}

void draw_frog(int startX, int startY, enum move DIRECTION){
    switch(DIRECTION){
      case 0: draw_frog_forwards(startX, startY); break;
      case 1: draw_frog_right(startX, startY);  break;
      case 2: draw_frog_left(startX, startY); break;
      default: draw_frog_forwards(startX, startY); break;
    }
}

void draw_frog_forwards(int startX, int startY){
  int x = startX;
  int y = startY;

  // If user prompts log to be drawn out of position, it's illegal.
  if (within_bounds(x,y) == 0) return;
  for (int i = 0; i < sizeof(frogImage)/sizeof(short int); i+=2){

    /* Draw the log up to its width. */
    if (x >= startX + frog.width){
      x = startX;
      y++;
    }

    if ((frogImage[i] << 8) + frogImage[i+1] != 0xffff){
        plot_pixel(x, y, (frogImage[i] << 8) + frogImage[i+1]);
    } // if
    x++;
  } //
}

void draw_frog_left(int startX, int startY){
  int x = startX;
  int y = startY + frog.height;

  // If user prompts log to be drawn out of position, it's illegal.
  if (within_bounds(x,y) == 0) return;
  for (int i = 0; i < sizeof(frogImage)/sizeof(short int); i+=2){

    /* Draw the log up to its width. */
    if (y <= startY){
      y = startY + frog.height;
      x++;
    }

    if ((frogImage[i] << 8) + frogImage[i+1] != 0xffff){
        plot_pixel(x, y, (frogImage[i] << 8) + frogImage[i+1]);
    } // if
    y--;
  } //
}

void draw_frog_right(int startX, int startY){
  int x = startX + frog.width;
  int y = startY;

  // If user prompts log to be drawn out of position, it's illegal.
  if (within_bounds(x,y) == 0) return;
  for (int i = 0; i < sizeof(frogImage)/sizeof(short int); i+=2){

    /* Draw the log up to its height. */
    if (y >= startY + frog.height){
      y = startY;
      x--;
    }

    if ((frogImage[i] << 8) + frogImage[i+1] != 0xffff){
        plot_pixel(x, y, (frogImage[i] << 8) + frogImage[i+1]);
    } // if
    y++;
  } //
}


