void draw_text(int startX, int startY, short int image[], int width, int length, bool erase){
    int x = startX;
    int y = startY;
    for (int i = 0; i < length; i += 2) {

        /* Draw the log up to its width. */
        if (x >= startX + width) {
            x = startX;
            y++;
        }

        if (erase){
            if ((image[i] << 8) + image[i+1] == 0x0000)
                plot_pixel(x, y, (image[i] << 8) + image[i + 1]);
        }
        else plot_pixel(x, y, 0x07E0);

        x++;

    } // for
 }
